-- ----------------------------
-- View structure for daftar_kepala_sie
-- ----------------------------
CREATE OR REPLACE VIEW "sc_skp"."daftar_kepala_sie" AS 
 SELECT DISTINCT ((((((((((jabatan_data_dukung_pegawai_part_1.non_singkatan || ' '::text) || jabatan_data_dukung_pegawai.part_dua) || ' '::text) || jabatan_data_dukung_pegawai.part_tiga) || ' '::text) || jabatan_data_dukung_pegawai.part_empat) || ' '::text) || jabatan_data_dukung_pegawai.part_lima) || ' '::text) || jabatan_data_dukung_pegawai.part_enam) AS kepala_sie
   FROM (sc_skp.jabatan_data_dukung_pegawai
     JOIN sc_skp.jabatan_data_dukung_pegawai_part_1 ON ((jabatan_data_dukung_pegawai_part_1.part_satu = jabatan_data_dukung_pegawai.part_satu)))
  WHERE (jabatan_data_dukung_pegawai.part_satu = 'Kasie.'::text);

-- ----------------------------
-- View structure for jabatan_data_dukung_pegawai
-- ----------------------------
CREATE OR REPLACE VIEW "sc_skp"."jabatan_data_dukung_pegawai" AS 
 SELECT DISTINCT split_part((data_dukung_pegawai.jabatan)::text, ' '::text, 1) AS part_satu,
    split_part((data_dukung_pegawai.jabatan)::text, ' '::text, 2) AS part_dua,
    split_part((data_dukung_pegawai.jabatan)::text, ' '::text, 3) AS part_tiga,
    split_part((data_dukung_pegawai.jabatan)::text, ' '::text, 4) AS part_empat,
    split_part((data_dukung_pegawai.jabatan)::text, ' '::text, 5) AS part_lima,
    split_part((data_dukung_pegawai.jabatan)::text, ' '::text, 6) AS part_enam
   FROM sc_skp.data_dukung_pegawai;

-- ----------------------------
-- View structure for jabatan_data_dukung_pegawai_part_1
-- ----------------------------
CREATE OR REPLACE VIEW "sc_skp"."jabatan_data_dukung_pegawai_part_1" AS 
 SELECT DISTINCT
        CASE
            WHEN (jabatan_data_dukung_pegawai.part_satu = 'Kasubbag.'::text) THEN 'Kepala Sub Bagian'::text
            WHEN ((jabatan_data_dukung_pegawai.part_satu = 'Kasie.'::text) OR (jabatan_data_dukung_pegawai.part_satu = 'kasie.'::text)) THEN 'Kepala Sie'::text
            WHEN (jabatan_data_dukung_pegawai.part_satu = 'Kasubbid.'::text) THEN 'Kepala Sub Bidang'::text
            WHEN (jabatan_data_dukung_pegawai.part_satu = 'Kabag.'::text) THEN 'Kepala Bagian'::text
            WHEN (jabatan_data_dukung_pegawai.part_satu = 'Kabid.'::text) THEN 'Kepala Bidang'::text
            WHEN (jabatan_data_dukung_pegawai.part_satu = 'Ka.'::text) THEN 'Kepala'::text
            WHEN ((jabatan_data_dukung_pegawai.part_satu = 'Sekr.'::text) OR (jabatan_data_dukung_pegawai.part_satu = 'Sekretaris.'::text)) THEN 'Sekretaris'::text
            WHEN (jabatan_data_dukung_pegawai.part_satu = 'SEKR.INSPEKTORAT'::text) THEN 'Sekretaris Inspektorat'::text
            WHEN (jabatan_data_dukung_pegawai.part_satu = 'Insp.'::text) THEN 'Inspektur'::text
            WHEN (jabatan_data_dukung_pegawai.part_satu = 'SEKR.CAMAT'::text) THEN 'Sekretaris Camat'::text
            ELSE jabatan_data_dukung_pegawai.part_satu
        END AS non_singkatan,
    jabatan_data_dukung_pegawai.part_satu
   FROM sc_skp.jabatan_data_dukung_pegawai;

-- ----------------------------
-- View structure for skpd_data_dukung_pegawai
-- ----------------------------
CREATE OR REPLACE VIEW "sc_skp"."skpd_data_dukung_pegawai" AS 
 SELECT DISTINCT data_dukung_pegawai.skpd
   FROM sc_skp.data_dukung_pegawai;

-- ----------------------------
-- View structure for v_user
-- ----------------------------
CREATE OR REPLACE VIEW "sc_skp"."v_user" AS 
 SELECT backbone_user.id_user,
    backbone_user.username,
    backbone_user.record_active,
    backbone_profil.id_profil,
    backbone_profil.nama_profil,
    backbone_profil.email_profil
   FROM (sc_skp.backbone_user
     JOIN sc_skp.backbone_profil ON ((backbone_profil.id_user = backbone_user.id_user)));

